import React from "react";

export const dataSource = [
  {
    key: "1",
    name: "Mike",
    age: 32,
    addresss: "10 Downing Street",
  },
  {
    key: "2",
    name: "John",
    age: 42,
    addresss: "10 Downing Street",
  },
];

export const columns = [
  {
    title: "Name",
    dataIndex: "name",
    key: "name",
  },
  {
    title: "Age",
    dataIndex: "age",
    key: "age",
  },
  {
    title: "Addresss",
    dataIndex: "addresss",
    key: "address",
  },
];
